import React from 'react';

import Event from './components/Event';
import Notificationbar from './components/Notificationbar';
import Events from './components/Events';

function App() {
  return (
    <div>
      <Notificationbar></Notificationbar>
    
      <Event />
      <Events></Events>
    </div>
  );
}

export default App;
